package LAB_4;

public class numbersOutput60 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i = 0; i < 6; i++) {
			for (int j = 0; j < 10; j++) {
				System.out.print(" ");
			}
			System.out.print("|");
		}
		
		System.out.println();
		
		for (int i = 0; i < 6; i++) {
			for (int j = 0; j < 10; j++) {
				System.out.print(j);
			}
			System.out.print("0");
		}
	}

}
